import React from "react";
import {Link} from 'react-router-dom';
import { withAuth } from '@okta/okta-react';

export default withAuth(class ProfileBar extends React.Component {
  constructor() {
    super()
    this.state = {
      name:null
    };
    this.logout = this.logout.bind(this);
  }
  async logout() {
    this.props.auth.logout('/Login');
  }
  render() {
    this.props.auth.getUser().then(res =>{
      console.log(res);
      const login = res.preferred_username;
      this.setState({name:res.name})
    })
    return (
      <div>
        <nav className="navbar navbar-expand-lg navbar-dark bg-primary">         
            <ul className="navbar-nav mr-auto">
              <li >
              <Link className="nav-link"><b>{this.state.name}</b></Link>
              </li>
              <li  >
              <Link className="nav-link"><b>PA3</b></Link>
              </li>
              <li  >
              <Link className="nav-link"><b>Male</b></Link>
              </li>
              <li  >
              <Link className="nav-link"><b>25</b></Link>
              </li>
              <li  >
                <Link onClick={this.logout} className="nav-link"><b>Logout</b></Link>
              </li>
            </ul>
        </nav>
      </div>
    );
  }
});
